import 'package:flutter/foundation.dart';class Patient {  String name ;  String lastname ;  String email ;  String password ;  String  phonenumber ;  String birthday ;  String sexe ;  String role ;  String birthplace;  String situation ;  String adresse ;  String wilaya ;  String add ;  String bloodgroupe;  Patient({    @required this.name,      @required this.bloodgroupe ,    @required  this.lastname,    @required this.email,    @required  this.password,  @required this.phonenumber,    @required this.role,    @required this.sexe,    @required  this.birthday,  @required this.birthplace,    @required this.add,  @required this.wilaya,    @required this.adresse,   @required this.situation ,  });  toMap() {    return {      "name" : this.name,      "lastname" :this.lastname ,      "role":this.role ,      "sexe":this.sexe ,      "birthday":this.birthday ,      "phonenumber":this.phonenumber,      "password": this.password ,      "email":this.email,      "birthplace":this.birthplace,      "add": this.add,      "situation" : this.situation,      "adresse" : this.adresse,      "wilaya" : this.wilaya,      "bloodgroupe" : this.bloodgroupe,    };  }  @override  String toString() {    return super.toString();  }}